css:
@-moz-document
	url-prefix('http://www.tumblr.com/'),
	url-prefix('https://www.tumblr.com/')
{

.new_post_label/*_icon*/ > I {display: none !important}

.new_post_label {
  padding: 79px 1px 0px 0 !important;
  text-transform: lowercase;
}
.new_post_label:hover {
  padding: 74px 1px 5px 0 !important;
  font-weight: bold !important;
}

.new_post_buttons {
  background: #fff center no-repeat url('data:image/png;base64,') !important;
}

}
